import React, { useState } from "react";
import { useEffect } from "react";
// import Footer from './Footer'
// import Navbar from './Navbar'
// import RegistrationStudent from "./Images/Registration_Student.jpg";

export default function Registration_Student() {
  useEffect(() => {
    document.title = "Registration - CollegeFun";
  }, []);

  const [student, setStudent] = useState({
    fname: "",
    mname: "",
    lname: "",
    gender: "male",
    email: "",
    phone: "",
    country: "",
    state: "",
    education: "",
    institution: "",
    password: "",
  });
  // const host = "http://localhost:5000";
  // const navigate = useNavigate();
  const handleClick = async (e) => {
    e.preventDefault();
    console.log(student);
    // API call
    //   const response = await fetch(`${host}/api/auth/createuser`, {
    //     method: "POST",
    //     headers: {
    //       "Content-Type": "application/json",
    //     },
    //     body: JSON.stringify(credential),
    //   });
    //   const json = await response.json();
    //   console.log(json);
    //   if (json.success) {
    //     localStorage.setItem("token", json.authToken);
    //     navigate("/");
    //     alert("Created Acoount Successfully", "success");
    //   } else {
    //     alert("Please enter valid crediatials", "danger");
    //   }
  };
  const onChange = (e) => {
    setStudent({ ...student, [e.target.name]: e.target.value });
  };

  return (
    <>
      {/* <div
        id="carouselExampleSlidesOnly"
        className="carousel slide"
        data-bs-ride="carousel"
      >
        <div className="carousel-inner">
          <div className="carousel-item active">
            <img
              src={RegistrationStudent}
              className="d-block w-100"
              height={600}
              alt="..."
            />
            <div
              className="text-dark text-center"
              style={{
                position: "absolute",
                top: "50%",
                left: "50%",
                transform: "translate(-50%, -50%)",
              }}
            >
              <h1>Registration Form For Student</h1>
            </div>
          </div>
        </div>
      </div> */}

      <div className="container" style={{ width: "700px", paddingTop: "50px" }}>
        <div className="mb-3 mt-5">
          <h2 className="mt-5 mb-4 text-center">Student Registration Form</h2>
          <label htmlFor="exampleFormControlInput1" className="form-label mt-3">
            First Name
          </label>
          <input
            type="text"
            className="form-control"
            id="fname"
            name="fname"
            placeholder="Enter your first name"
            onChange={onChange}
          />
          <label htmlFor="exampleFormControlInput1" className="form-label mt-3">
            Middle Name
          </label>
          <input
            type="text"
            className="form-control"
            id="mname"
            name="mname"
            onChange={onChange}
            placeholder="Enter your middle name"
          />
          <label htmlFor="exampleFormControlInput1" className="form-label mt-3">
            Last Name
          </label>
          <input
            type="text"
            className="form-control"
            id="lname"
            name="lname"
            onChange={onChange}
            placeholder="Enter your last name"
          />
          <label htmlFor="exampleFormControlInput1" className="form-label mt-3">
            Gender
          </label>
          <select
            class="form-select"
            aria-label="Default select example"
            id="gender"
            onChange={onChange}
          >
            <option selected>Select your gender</option>
            <option value="male" name="gender">
              Male
            </option>
            <option value="female" name="gender">
              Female
            </option>
            <option value="other" name="gender">
              Other
            </option>
          </select>
          <label htmlFor="exampleFormControlInput1" className="form-label mt-3">
            Email address
          </label>
          <input
            type="email"
            className="form-control"
            id="email"
            onChange={onChange}
            name="email"
            placeholder="name@example.com"
          />{" "}
          <label htmlFor="exampleFormControlInput1" className="form-label mt-3">
            Phone No.
          </label>
          <input
            type="number"
            className="form-control"
            iid="phone"
            name="phone"
            placeholder="Enter your phone no."
            onChange={onChange}
          />
          <label htmlFor="exampleFormControlInput1" className="form-label mt-3">
            Country
          </label>
          <input
            type="text"
            className="form-control"
            id="country"
            name="country"
            onChange={onChange}
            placeholder="Enter your country"
          />
          <label htmlFor="exampleFormControlInput1" className="form-label mt-3">
            State
          </label>
          <input
            type="text"
            className="form-control"
            id="state"
            name="state"
            onChange={onChange}
            placeholder="Enter your state"
          />
          <label htmlFor="exampleFormControlInput1" className="form-label mt-3">
            City
          </label>
          <input
            type="text"
            className="form-control"
            id="city"
            name="city"
            onChange={onChange}
            placeholder="Enter your city"
          />
        </div>
        <label htmlFor="exampleFormControlInput1" className="form-label mt-3">
          Higher Qualification
        </label>
        <input
          type="text"
          className="form-control"
          id="education"
          name="education"
          onChange={onChange}
          placeholder="Enter your higher Qualification."
        />
        <label htmlFor="exampleFormControlInput1" className="form-label mt-3">
          Institution
        </label>
        <input
          type="text"
          className="form-control mb-5"
          id="institution"
          name="institution"
          onChange={onChange}
          placeholder="Enter your instutution name."
        />

        <div>
          <hr />
          <h6>Set Password</h6>
          <label htmlFor="exampleFormControlInput1" className="form-label mt-3">
            Password
          </label>
          <input
            type="password"
            className="form-control"
            id="password"
            name="password"
            onChange={onChange}
            placeholder="Enter your password"
          />
          <label htmlFor="exampleFormControlInput1" className="form-label mt-3">
            Confirm Password
          </label>
          <input
            type="password"
            className="form-control"
            id="cpassword"
            name="cpassword"
            placeholder="Confirm your password"
          />
        </div>
        <div className="mt-2">
          <div className="text-center mt-4 mb-5">
            <button
              type="reset"
              className="btn btn-success ps-3 pe-3 mx-3"
              style={{ backgroundColor: "#19A7CE", color: "#fff" }}
            >
              Reset
            </button>
            <button
              type="button"
              className="btn btn-warning ps-3 pe-3 mx-3"
              style={{ backgroundColor: "#19A7CE", color: "#fff" }}
              onClick={handleClick}
            >
              Submit
            </button>
          </div>
        </div>
      </div>
    </>
  );
}
